    if (globofilter.queryParams.hasOwnProperty('sort_by')) params['sort_by'] = globofilter.queryParams.sort_by;

    if (globofilter.queryParams.hasOwnProperty('limit')) params['limit'] = globofilter.queryParams.limit;

    if (Object.keys(params).length > 0) filter_url = '?' + decodeURIComponent(gF.param(params));

